@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {

  constructor(private shiva){}

  Obser1:any;
  Obseravablemethod(){
    this.kumar.Observable$.subscribe(res=>{
      this.Obser1=res;
    });
  }

  savedata:any;
  save(){
    this.kumar.Observable$.next(this.savedata)
  }

  ngOnInit() {
    this.getitems();
    this.Obseravablemethod();
  }

}
